import { BrowserRouter as Router, Routes, Route } from "react-router-dom"; 
import Login from "./pages/Login"; 
import Home from "./pages/Home";
import Register from "./pages/Register";
import Medicines from "./components/Medicines";
import AdminDashboard from "./components/AdminDashboard";
import NavBar from "./pages/NavBar";
import UserDashboard from "./components/AdminDashboard";
import ListMedicines from "./pages/listMedicine";
import AddEditMedicine from "./pages/AddEditMedicine.js";
import AllUsers from "./pages/AllUsers";
import MedicineBookings from "./pages/MedicineBookings";
import ChangePassword from "./Userpage/Changepassword.js";
import UserProductViews from "./Userpage/UserProductViews";
import Cart from "./pages/Cart";
import NotFound from "./pages/NotFound"; // Optional 404 page

function App() {
  return (
    <div className="App">
      <Router>
        {/* Display NavBar on every page */}
        <NavBar />

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/medicines" element={<Medicines />} />
          <Route path="/list-medicine" element={<ListMedicines />} />
          <Route path="/admin/add-edit-medicine" element={<AddEditMedicine />} />
          <Route path="/admin/dashboard" element={<AdminDashboard />} />
          <Route path="/user/dashboard" element={<UserDashboard />} />
          <Route path="/user/home" element={<Home />} />
          <Route path="/user" element={<AllUsers />} />
          <Route path="/cart" element={<Cart />} />
          <Route path="/medicine-bookings" element={<MedicineBookings />} />
          <Route path="/user-product-views" element={<UserProductViews />} />
          <Route path="/change-password" element={<ChangePassword />} />

          {/* Optional: catch-all route for undefined paths */}
          <Route path="*" element={<NotFound />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
